订阅公共流。
@param nResumeType 公共流重传方式  
       THOST_TERT_RESTART:从本交易日开始重传
       THOST_TERT_RESUME:从上次收到的续传
       THOST_TERT_QUICK:只传送登录后公共流的内容
@remark 该方法要在Init方法前调用。若不调用则不会收到公共流的数据。

